<head>

<title>Pediatric ECG Viewer (Classic)</title>
<style>
  :root{

  }

const fs = DATA.fs;
const leads = ["I","II","III","aVR","aVL","aVF","V1","V2","V3","V4","V5","V6","V3R","V4R","V7"].filter(x=>DATA.leads[x]);
const canvas = document.getElementById("c");
const ctx = canvas.getContext("2d", { alpha: false });

function resizeCanvas(){
  const cssW = canvas.clientWidth || 1200;
  const cssH = canvas.clientHeight || 820;
  const dpr = window.devicePixelRatio || 1;
  canvas.width = Math.floor(cssW * dpr);
  canvas.height = Math.floor(cssH * dpr);
  ctx.setTransform(dpr,0,0,dpr,0,0);
}
resizeCanvas();
window.addEventListener("resize", ()=>{ resizeCanvas(); draw(); });

let calipers=false;
let pts=[];
let t0=0;
let drag=null;

function pxPerMm(){ return +document.getElementById("pxmm").value; }
function speed(){ return +document.getElementById("speed").value; }
function gain(){ return +document.getElementById("gain").value; }
function pxPerSec(){ return speed()*pxPerMm(); }
function pxPerUv(){ return (gain()*pxPerMm())/1000.0; }
function windowSeconds(){ return canvas.clientWidth/pxPerSec(); }

document.getElementById("calBtn").onclick=()=>toggleCalipers();
document.getElementById("clearBtn").onclick=()=>{ pts=[]; draw(); };
document.getElementById("speed").onchange=()=>{ clampT0(); draw(); };
document.getElementById("gain").onchange =()=>{ draw(); };
document.getElementById("pxmm").onchange =()=>{ clampT0(); draw(); };

function toggleCalipers(){
  calipers=!calipers;
  pts=[];
  document.getElementById("calBtn").textContent="Calipers: "+(calipers?"ON":"OFF");
  draw();
}
window.addEventListener("keydown",(e)=>{ if(e.key.toLowerCase()==="c") toggleCalipers(); });

canvas.addEventListener("mousedown",(e)=>{
  const r=canvas.getBoundingClientRect();
  drag={x:e.clientX-r.left,t0:t0};
});
window.addEventListener("mouseup",()=>{drag=null;});
window.addEventListener("mousemove",(e)=>{
  if(!drag) return;
  const r=canvas.getBoundingClientRect();
  const x=e.clientX-r.left;
  const dx=x-drag.x;
  t0 = drag.t0 - (dx/pxPerSec());
  clampT0();
  draw();
});
canvas.addEventListener("wheel",(e)=>{
  e.preventDefault();
  const sel=document.getElementById("pxmm");
  const vals=["4","6","8"];
  const i=vals.indexOf(sel.value);
  const dir=Math.sign(e.deltaY);
  let ni=i+(dir>0?-1:1);
  ni=Math.max(0,Math.min(vals.length-1,ni));
  if(ni!==i){
    const center=t0+windowSeconds()/2;
    sel.value=vals[ni];
    t0=center-windowSeconds()/2;
    clampT0();
    draw();
  }
},{passive:false});

canvas.addEventListener("click",(e)=>{
  if(!calipers) return;
  const r=canvas.getBoundingClientRect();
  pts.push({x:e.clientX-r.left,y:e.clientY-r.top});
  if(pts.length>2) pts=[pts[pts.length-2], pts[pts.length-1]];
  draw();
});

function clampT0(){
  const totalSec=DATA.leads[leads[0]].length/fs;
  const win=windowSeconds();
  if(win>=totalSec){ t0=0; return; }
  t0=Math.max(0,Math.min(totalSec-win,t0));
}

function drawGrid(){
  const w=canvas.clientWidth,h=canvas.clientHeight;
  const mm=pxPerMm();
  const small=mm, big=mm*5;
  ctx.save();
  ctx.fillStyle=getComputedStyle(document.documentElement).getPropertyValue('--bg');
  ctx.fillRect(0,0,w,h);

  ctx.strokeStyle=getComputedStyle(document.documentElement).getPropertyValue('--grid1');
  ctx.lineWidth=1;
  for(let x=0;x<=w;x+=small){ctx.beginPath();ctx.moveTo(x,0);ctx.lineTo(x,h);ctx.stroke();}
  for(let y=0;y<=h;y+=small){ctx.beginPath();ctx.moveTo(0,y);ctx.lineTo(w,y);ctx.stroke();}

  ctx.strokeStyle=getComputedStyle(document.documentElement).getPropertyValue('--grid5');
  ctx.lineWidth=1.3;
  for(let x=0;x<=w;x+=big){ctx.beginPath();ctx.moveTo(x,0);ctx.lineTo(x,h);ctx.stroke();}
  for(let y=0;y<=h;y+=big){ctx.beginPath();ctx.moveTo(0,y);ctx.lineTo(w,y);ctx.stroke();}
  ctx.restore();
}

function drawCalibrationPulse(x0,y0){
  const ampUv=1000;
  const height=ampUv*pxPerUv();
  const w200=0.2*pxPerSec();
  const w50=0.05*pxPerSec();
  ctx.save();
  ctx.strokeStyle="rgba(20,20,20,0.55)";
  ctx.lineWidth=1.1;
  ctx.beginPath();
  ctx.moveTo(x0, y0);
  ctx.lineTo(x0+w50, y0);
  ctx.lineTo(x0+w50, y0-height);
  ctx.lineTo(x0+w50+w200, y0-height);
  ctx.lineTo(x0+w50+w200, y0);
  ctx.lineTo(x0+w50+w200+w50, y0);
  ctx.stroke();
  ctx.restore();
}

function draw(){
  resizeCanvas();
  clampT0();
  drawGrid();

  const w=canvas.clientWidth,h=canvas.clientHeight;
  const pps=pxPerSec(), ppu=pxPerUv();
  const win=windowSeconds();
  const startIdx=Math.floor(t0*fs);
  const n=Math.min(Math.floor(win*fs), DATA.leads[leads[0]].length-startIdx);

  const topPad=18, leftPad=70;
  const usableH=h-topPad-18;
  const rowH=usableH/leads.length;

  ctx.save();
  ctx.lineJoin="round";
  ctx.lineCap="round";
  ctx.font="13px system-ui, -apple-system, Segoe UI, Roboto, Arial";
  ctx.fillStyle=getComputedStyle(document.documentElement).getPropertyValue('--text');
  ctx.strokeStyle=getComputedStyle(document.documentElement).getPropertyValue('--trace');
  ctx.lineWidth=1.25;

  for(let li=0; li<leads.length; li++){
    const L=leads[li];
    const baseline=topPad+(li+0.72)*rowH;
    ctx.fillText(L, 12, baseline+4);
    drawCalibrationPulse(leftPad, baseline);

    const arr=DATA.leads[L];
    ctx.beginPath();
    for(let i=0;i<n;i++){
      const x=leftPad+(i/fs)*pps;
      const y=baseline-arr[startIdx+i]*ppu;
      if(i===0) ctx.moveTo(x,y); else ctx.lineTo(x,y);
    }
    ctx.stroke();
  }
  ctx.restore();

  const totalSec=DATA.leads[leads[0]].length/fs;
  document.getElementById("windowInfo").textContent = `Window: ${t0.toFixed(2)}–${(t0+win).toFixed(2)} s (Total ${totalSec.toFixed(1)} s)`;

  if(pts.length===2){
    const p0=pts[0], p1=pts[1];
    ctx.save();
    ctx.strokeStyle=getComputedStyle(document.documentElement).getPropertyValue('--warn');
    ctx.lineWidth=2;
    ctx.beginPath(); ctx.moveTo(p0.x,p0.y); ctx.lineTo(p1.x,p1.y); ctx.stroke();

    const dt_sec=(p1.x-p0.x)/pps;
    const dv_uv=-(p1.y-p0.y)/ppu;
    const dv_mv=dv_uv/1000.0;
    ctx.fillStyle=getComputedStyle(document.documentElement).getPropertyValue('--warn');
    ctx.font="13px system-ui, -apple-system, Segoe UI, Roboto, Arial";
    const label=`Δt ${(dt_sec*1000).toFixed(1)} ms   ΔV ${dv_mv.toFixed(3)} mV`;
    ctx.fillText(label, Math.min(p0.x,p1.x)+10, Math.min(p0.y,p1.y)-10);
    ctx.restore();
  }
}
draw();
</script>
</body>
